prompt --application/shared_components/security/authentications/application_express_authentication
begin
wwv_flow_api.create_authentication(
 p_id=>wwv_flow_api.id(14003634826605136)
,p_name=>'Application Express Authentication'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_03=>'AUTH'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION AUTH ',
'  (p_username IN VARCHAR2,  ',
'   p_password IN VARCHAR2) ',
'RETURN BOOLEAN ',
'IS ',
'  l_user_exist   NUMBER; ',
'  l_useremail    VARCHAR2(255) := UPPER(p_username);',
'  l_hashed_password VARCHAR2(255);',
'  l_user_password VARCHAR2(255);',
'  l_user_role VARCHAR2(255);',
'BEGIN ',
'  -- Check if email and password are provided',
'  IF p_username IS NULL OR p_username = '''' OR p_password IS NULL OR p_password = '''' THEN',
'    RAISE_APPLICATION_ERROR(-20005, ''Please enter your email and password.'');',
'  END IF;',
'',
'  -- Hash the plain text password',
'  l_hashed_password := UTL_RAW.CAST_TO_RAW(DBMS_OBFUSCATION_TOOLKIT.MD5(input_string => p_password));',
'',
'  -- Check if the user exists and retrieve necessary details',
'  BEGIN',
'    SELECT ',
'      USER_PASSWORD, ',
'      USER_TYPE',
'    INTO ',
'      l_user_password,',
'      l_user_role',
'    FROM ',
'      HUDDER_USER',
'    WHERE ',
'      UPPER(USER_EMAIL) = l_useremail;',
'',
'    -- Check if the email exists',
'    IF l_user_password IS NULL THEN',
'      RAISE_APPLICATION_ERROR(-20001, ''You are not a registered user at HudderFoods.'');',
'    END IF;',
'',
'    -- Check if the password matches',
'    IF UPPER(l_user_password) != UPPER(l_hashed_password) THEN',
'      RAISE_APPLICATION_ERROR(-20002, ''Incorrect password.'');',
'    END IF;',
'',
'    -- Check if the user role matches Admin',
'    IF UPPER(l_user_role) != ''ADMIN'' THEN',
'      RETURN FALSE;',
'    END IF;',
'',
'    -- If all conditions are met',
'    RETURN TRUE;',
'',
'  EXCEPTION',
'    WHEN NO_DATA_FOUND THEN',
'      RAISE_APPLICATION_ERROR(-20001, ''You are not a registered user at HudderFoods.'');',
'  END;',
'',
'EXCEPTION ',
'  -- Handle specific exceptions if needed',
'  WHEN OTHERS THEN',
'    RETURN FALSE;',
'END AUTH;',
'',
''))
,p_invalid_session_type=>'LOGIN'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
end;
