,p_chart_id=>wwv_flow_api.id(7932294405973838)
,p_seq=>10
,p_name=>'Series 1'
,p_data_source_type=>'SQL'
,p_data_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    P.PRODUCT_NAME,',
'    SUM(OD.PRODUCT_QTY) AS TOTAL_QUANTITY',
'FROM ',
'    ORDER_DETAILS OD',
'JOIN ',
'    PRODUCT P ON OD.PRODUCT_ID = P.PRODUCT_ID',
'JOIN ',
'    ORDER_PRODUCT OP ON OD.ORDER_PRODUCT_ID = OP.ORDER_PRODUCT_ID',
'WHERE ',
'     TRUNC(OP.ORDER_DATE) = TRUNC(SYSDATE)',
'GROUP BY ',
'    P.PRODUCT_NAME',
'ORDER BY ',
'    P.PRODUCT_NAME;',
