'    S.SHOP_DESCRIPTION,',
'    CASE ',
'        WHEN S.VERIFIED_SHOP = 1 THEN ''VERIFIED'' ',
'        ELSE ''UNVERIFIED'' ',
'    END AS VERIFICATION_STATUS,',
'    S.SHOP_CATEGORY_ID,',
'    S.REGISTRATION_NO,',
'    HU.FIRST_NAME || '' '' || HU.LAST_NAME AS OWNER,',
'    PC.CATEGORY_TYPE AS CATEGORY',
'FROM ',
'    SHOP S',
'JOIN ',
'    HUDDER_USER HU ON S.USER_ID = HU.USER_ID',
'JOIN ',
'    PRODUCT_CATEGORY PC ON S.SHOP_CATEGORY_ID = PC.CATEGORY_ID',
'',
'',
''))
