'WITH CustomerOrderCount AS (',
'    SELECT ',
'        OP.CUSTOMER_ID,',
'        COUNT(*) AS ORDER_COUNT',
'    FROM ',
'        ORDER_PRODUCT OP',
'    JOIN ',
'        ORDER_DETAILS OD ON OP.ORDER_PRODUCT_ID = OD.ORDER_PRODUCT_ID',
