'    JOIN ',
'        CUSTOMER C ON CO.CUSTOMER_ID = C.CUSTOMER_ID',
'    JOIN ',
'        HUDDER_USER U ON C.USER_ID = U.USER_ID',
'    ORDER BY ',
'        CO.ORDER_COUNT DESC',
')',
'WHERE ROWNUM <= 10;'))
