,p_plug_display_sequence=>10
,p_plug_display_point=>'BODY'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    P.PRODUCT_NAME, ',
'    P.PRODUCT_QUANTITY,',
'    CASE ',
'        WHEN P.PRODUCT_QUANTITY < 10 THEN ''Low''',
'        WHEN P.PRODUCT_QUANTITY >= 10 AND P.PRODUCT_QUANTITY <= 50 THEN ''Medium''',
'        ELSE ''High''',
'    END AS AVAILABILITY_STATUS,',
'    P.PRODUCT_ID,',
'    PC.CATEGORY_TYPE AS CATEGORY,',
'    HU.FIRST_NAME || '' '' || HU.LAST_NAME AS OWNER',
'FROM ',
'    PRODUCT P',
'JOIN ',
'    PRODUCT_CATEGORY PC ON P.CATEGORY_ID = PC.CATEGORY_ID',
'JOIN ',
'    HUDDER_USER HU ON P.USER_ID = HU.USER_ID',
'ORDER BY ',
'    P.PRODUCT_QUANTITY DESC;',
''))
,p_plug_source_type=>'NATIVE_IR'
);
